import React,{Component} from 'react';

class Card extends Component{
	render(){
		return (
			<div className = 'bg-light-green lib br3 mw5 pa3 ba b--black-10 shadow-1 ma2 grow'>
				<img src={`https://www.robohash.org/this.props.id?200x200`} alt='Photo did not load completely'/>
				<div>
					<h2>{this.props.name}</h2>
					<p>{this.props.email}</p>
				</div>
			</div>
			);
	}
}

export default Card;
